import React from 'react';
import UserCreateForm from './user/UserCreateForm';
import LoginForm from './user/LoginForm';

const Welcome = () => {
  return (
    <div className="welcome">
      <LoginForm />
      <h1>Don't have an account? Create one here!</h1>
    </div>
  )
}

export default Welcome;
